import React from 'react';

const ProjectShowcase: React.FC = () => {
    const projects = [
        { title: 'Cool Project', description: 'Lorem ipsum odor amet, consectetuer adipiscing elit. Leo ad amet ultricies nullam maecenas ipsum leo. Mattis ullamcorper arcu mauris justo per tincidunt congue dapibus. Proin nec purus nullam nibh augue aliquet euismod. Sed convallis metus facilisi mus mollis sollicitudin nisl. Gravida vulputate himenaeos dignissim porttitor nostra non montes amet sem. Sit interdum consectetur viverra maecenas nisi fames morbi est dignissim. Euismod sodales tellus suscipit eros turpis.', 
            imageUrl: 'https://futuretechnologies.com/wp-content/uploads/2016/05/placeholder.gif' },
        { title: 'Epic Project', description: 'Lorem ipsum odor amet, consectetuer adipiscing elit. Leo ad amet ultricies nullam maecenas ipsum leo. Mattis ullamcorper arcu mauris justo per tincidunt congue dapibus. Proin nec purus nullam nibh augue aliquet euismod. Sed convallis metus facilisi mus mollis sollicitudin nisl. Gravida vulputate himenaeos dignissim porttitor nostra non montes amet sem. Sit interdum consectetur viverra maecenas nisi fames morbi est dignissim. Euismod sodales tellus suscipit eros turpis.', 
            imageUrl: 'https://t3.ftcdn.net/jpg/06/04/96/54/360_F_604965492_lCfxDUwNF1YiogR3SN0lbmbdvFnfDCHa.jpg' },
        { title: 'Super Project', description: 'Lorem ipsum odor amet, consectetuer adipiscing elit. Leo ad amet ultricies nullam maecenas ipsum leo. Mattis ullamcorper arcu mauris justo per tincidunt congue dapibus. Proin nec purus nullam nibh augue aliquet euismod. Sed convallis metus facilisi mus mollis sollicitudin nisl. Gravida vulputate himenaeos dignissim porttitor nostra non montes amet sem. Sit interdum consectetur viverra maecenas nisi fames morbi est dignissim. Euismod sodales tellus suscipit eros turpis.', 
            imageUrl: 'https://complianz.io/wp-content/uploads/2020/05/Screenshot-2021-09-23-at-13.39.36.png' },
    ];

    const handleProjectClick = (projectTitle: string) => {
        alert(`You clicked ${projectTitle}`);
        // Or navigate to project details, open modal, etc
    };

    return (
        <div className="project-showcase">
            <h2>Recent Projects</h2>
            <ul>
                {projects.map((project, index) => (
                    <li 
                        key={index} 
                        className="project-item"
                        onClick={() => handleProjectClick(project.title)}
                        style={{ cursor: 'pointer' }}
                    >
                        <h3>{project.title}</h3>
                        <img src={project.imageUrl} alt={project.title} className="project-image" />    
                        <p>{project.description}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default ProjectShowcase;
